import {cambiar_color} from "./DrawingCanvas"

const Boton_Herramienta = (props) => {
    return (
        <button class="boton_imagen" onClick= {props.onClick}>
            <img class="imagen" src={props.src} alt={props.alt} />
        </button>
    )
}

